const ItemList = ({promesa}) => { 

  
    return (
        <>
        {promesa.map(()=>{
            return (
            <Item name={promesa.name} price={promesa.price} stock={promesa.stock} id={promesa.id} />
        )}
            
        ) } 

    </>
)}

export default ItemList
